<!DOCTYPE html>
<html lang="en">

<head>
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">

    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Beauty Shop Voucher</title>

    <style>
        @font-face {
            font-family: 'Noto Sans Myanmar';
            font-style: normal;
            font-weight: 400;
            src: url(data:font/woff2;base64,) format('woff2');
            unicode-range: U+1000-109F, U+200C-200D, U+25CC, U+A9E0-A9FE, U+AA60-AA7E, U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
        }

        body {
            font-family: 'Noto Sans Myanmar', sans-serif;
        }

        .container {
            padding: 1rem;
            margin-left: auto;
        }

        .header {
            display: flex;
            flex-wrap: nowrap;
            justify-content: space-between;
        }

        .uppercase {
            text-transform: uppercase;
            margin: 0px;
            font-size: 0.5rem;
        }

        .address {
            margin: 0px;
            font-size: 0.5rem;
        }

        .info {
            display: flex;
            flex-wrap: wrap;
            justify-content: space-between;
            padding-top: 0.5rem;
            padding-bottom: 0.5rem;
        }
    </style>
</head>

<body>
<div class="container">
    <!-- Header -->
    <div class="header">
        <div>
            <h3 class="uppercase">Beauty Shop</h3>

            <p class="address">Hello</p>
            <p class="address">Hotline - 0994394343</p>
        </div>
        <div class="w-32 rounded-lg">
        </div>
    </div>

    <!-- Info -->
    <div class="info">
        <div>
            <p style="font-size: 0.5rem;">
                <i class="fa-solid fa-circle-user" style="font-size: 0.5rem;"></i> {{$order->customer_name}}
            </p>
            <p style="margin: 0px; font-size: 0.5rem;">
                <i class="fa-solid fa-phone" style="font-size: 0.5rem;"></i> {{$order->customer_phone}}
            </p>
        </div>
        <div>
            <p class="w-40 flex flex-nowrap justify-between"
               style="font-size: 0.5rem; width: 6rem; display: flex; flex-wrap: nowrap; justify-content: space-between;">
                No <span class="text-2xl">{{$order->voucher_no}}</span>
            </p>
            <p class="w-40 flex flex-nowrap justify-between"
               style="margin: 0px; font-size: 0.5rem; width: 6rem; display: flex; flex-wrap: nowrap; justify-content: space-between;">
                <span>Date</span> {{$order->created_at->format('d.m.Y')}}
            </p>
        </div>
    </div>

    <!-- Table -->
    <div class="my-4" style="margin-top: 0rem; margin-bottom: 0rem;">
        <table class="table-fixed border border-gray-500 w-full"
               style="width: 100%; border: 1px solid rgb(107, 114, 128); table-layout: fixed; border-collapse: collapse; text-indent: 0;">
            <thead>
            <tr class="bg-gray-600"
                style="">
                <th class="w-3/4 border border-gray-500 p-2"
                    style="width: 75%; border: 1px solid rgb(107, 114, 128); padding: 0.5rem; font-size: 0.5rem;">
                    အကြောင်းအရာ</th>
                <th class="border border-gray-500 p-2"
                    style="border: 1px solid rgb(107, 114, 128); padding: 0.5rem; font-size: 0.5rem;">
                    ဈေးနှုန်း</th>
            </tr>
            </thead>
            <tbody>
            <tr class="h-64">
                <td class="border border-gray-500 p-2"
                    style="font-size: 0.5rem; border: 1px solid rgb(107, 114, 128); padding: 0.5rem;">hello -
                    <span>Hello </span>
                    <br>
                    <span>Hello</span>

                    <br>
                    <span>{{$order->description}}</span>

                </td>
                <td class="text-center border border-gray-500 py-2"
                    style="font-size: 0.5rem; text-align: center; border: 1px solid rgb(107, 114, 128); padding: 0.5rem;">
                    {{ number_format($order->price) }}</td>
            </tr>
            <tr>
                <td class="bg-gray-600 text-white text-center border border-gray-500 py-2"
                    style=" border: 1px solid rgb(107, 114, 128); padding: 0.5rem; text-align: center; font-size: 0.5rem;">
                    စုစုပေါင်း</td>
                <td class="text-center border border-gray-500 py-2"
                    style="font-size: 0.5rem; border: 1px solid rgb(107, 114, 128); padding: 0.5rem; text-align: center;">
                    {{number_format($order->price)}}</td>
            </tr>
            </tbody>
        </table>

    </div>

    <!-- footer -->
    <div class="flex flex-wrap justify-between py-8"
         style="display: flex; flex-wrap: wrap; justify-content: space-between; padding-bottom: 1rem;">
        <div class="mt-4 flex flex-col justify-between"
             style="margin-top: 1rem; display: flex; flex-direction: column; justify-content: space-between;">
            <p style="font-size: 0.5rem;">Sale Name</p>
            <div style="font-size: 0.5rem;">
                <i class="fa-solid fa-user-gear pr-6" style="padding-right: 1.5rem;"></i> Hello
            </div>
        </div>
    </div>
</div>
</body>

</html>
